import React from "react";
import AllList from "./AllList";
import { Button, Card, CardBody, CardSubtitle, CardText, Container } from "reactstrap";

const OneList = ({ product }) => {
    return (
        <Card style={{height: '200px', borderBlockEndColor: 'black', width: '900px'}}>
            <CardBody>
                <CardSubtitle className="font-weight-bold">Product Name : {product.productName}</CardSubtitle>
                <CardText>Prize : {product.prize}</CardText>
                <CardText>Date : {product.issueDate}</CardText>
                <CardText>Site : {product.siteName}</CardText>
                <CardText>Partner : {product.partnersName}</CardText>
                <Container className="text-center">
                    <Button color="danger">Delete</Button>
                    <Button color="warning">Update</Button>
                </Container>
            </CardBody>
        </Card>
    );
};

export default OneList
